  18,\n\t\"tags\": [],\n\t\"title\": \"Dissolved inorganic carbon, alkalinity, temperature,
  salinity and other variables collected from discrete sample and profile observations
  using CTD, bottle and other instruments from the HAKON MOSBY in the North Greenland
  Sea and Norwegian Sea from 1998-03-08 to 1998-03-24 (NODC Accession 0113546)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-26T19:22:41.255012\",\n\t\"name\": \"dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-d\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113546 includes chemical,
  discrete sample, physical and profile data collected from HAKON MOSBY in the North
  Greenland Sea and Norwegian Sea from 1998-03-08 to 1998-03-24 and retrieved during
  cruise CARINA/58AA19980308. These data include ALKALINITY, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by Truls Johannessen
  of University of Bergen; Bjerknes Center for Climate Research; Geophysical Institute
  and K. Simonsen [affiliation unknown] as part of the CARINA/58AA19980308 data set.nnThe
  CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
